	let images = {};
	r.keys().map((item, index) => {
		images[item.replace('./', '')] = r(item);
	});
	return images;
}
const images = importAll(require.context('./assets', false, /\.(png|jpe?g|svg)$/));

function Project5() {
	return (
		<div className="Espresso">
			<img className="R5" src={images['R5.png']} alt="rectangle5" />
